import React from 'react';
import './App.css';
import Nav from './Nav';
import Page_Principale from './Page_Principale'
import Page_Admin from './Components/Page_Admin'
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'
function App() {
    return(
        <Router>
            <div className="App">
                <Nav></Nav>
                <Route path="/Page_Principale" 
                       component="Page_Principale">
                <Route path="/Page_Admin" 
                       component="Page_Admin"></Route>
                    

                </Route>

            </div>

        </Router>
    );
}

export default App;
